import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import FloatingMenu from './components/FloatingMenu.jsx';
import Home from './components/Home.jsx';
import ResumeVerification from './components/ResumeVerification.jsx';
import ResumeAnalytics from './components/ResumeAnalytics.jsx';
import Login from './components/Login.jsx';
import Signup from './components/Signup.jsx';
import { AnalyticsProvider } from './context/AnalyticsContext';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import './App.css';

const AppContent = () => {
  const location = useLocation();
  const showMenu = !['/login', '/signup'].includes(location.pathname);

  return (
    <AnalyticsProvider>
      <div className="App">
        <Navbar />
        {showMenu && <FloatingMenu />}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/resume-verify" element={<ResumeVerification />} />
          <Route path="/resume-analytics" element={<ResumeAnalytics />} />
        </Routes>
      </div>
    </AnalyticsProvider>
  );
};

function App() {
  return (
    <Router>
      <AuthProvider>
        <AppContent />
      </AuthProvider>
    </Router>
  );
}

export default App;
